import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import * as Icon from 'react-bootstrap-icons';
import Navbar from './Navbar.js';
import './Chennaihospital.css';
import {Container , Row, Col} from 'react-bootstrap';
import { toBeRequired } from "@testing-library/jest-dom/dist/matchers";

function ChennaiHospital(){
    return(
        <div>
            
            <Navbar />
            <Container className="back" fluid>
                <br></br>
                <h1 className="gog">Chennai Hospitals</h1>
                <br>
                </br>
                <br></br>
                <Row justify="around" >
                    
                    <Col md={1}><h1>1.</h1></Col>
                    <Col md={5}><img src={require('./apollo.jpg')} width={450} height={350}></img></Col>
                    <div className="v1"></div>

                    <CCard style={{ width: '18rem' }}>
  <CCardBody>
    <CCardTitle>Card title</CCardTitle>
    <CCardSubtitle className="mb-2 text-medium-emphasis">Card subtitle</CCardSubtitle>
    <CCardText>
      Some quick example text to build on the card title and make up the bulk of the card's content.
    </CCardText>
    <CCardLink href="#">Card link</CCardLink>
    <CCardLink href="#">Another link</CCardLink>
  </CCardBody>
</CCard>

                </Row>

            </Container>

        
        </div>

    );
}
export default ChennaiHospital;
